query PostByPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    id
    html
    frontmatter {
      title
      path
      images
      category
      tags
      date
      components {
        rootId
        fileName
      }
      tweets {
        rootId
        userId
        tweetId
      }
      summary
    }
  }
}

