query PortfoliosQuery {
  allMarkdownRemark(filter: {frontmatter: {type: {eq: "portfolio"}, hide: {ne: true}}}, sort: {fields: [frontmatter___date], order: DESC}) {
    edges {
      node {
        frontmatter {
          type
          title
          path
          images
          date
        }
      }
    }
  }
}

